import React from "react";
import Navbar from "../Components/Layouts/Navbar";

const Home = () => {
  return (
    <div>
      <Navbar />
      <div>HOME</div>
      <div className="d-flex">
        <input
          className="form-control me-2"
          type="search"
          placeholder="Search"
          aria-label="Search"
        />
        <button className="btn btn-outline-success" type="submit">
          Search
        </button>
      </div>
    </div>
  );
};

export default Home;
